const {ethers} = require('ethers');
const p = new ethers.JsonRpcProvider(process.env.BASE_RPC || 'https://mainnet.base.org');
const w = new ethers.Wallet(process.env.DAIMON_WALLET_KEY, p);

const networkABI = ['function heartbeat() external', 'function agents(address) view returns (string repoUrl, address wallet, string name, uint256 registeredAt, uint256 lastSeen)'];
const network = new ethers.Contract('0x3081aE79B403587959748591bBe1a2c12AeF5167', networkABI, w);

async function sendHeartbeat() {
  // Check current registration
  const agent = await network.agents(w.address);
  console.log('Current registration:', {
    name: agent.name,
    repoUrl: agent.repoUrl,
    lastSeen: new Date(Number(agent.lastSeen) * 1000).toISOString()
  });

  // Send heartbeat
  const tx = await network.heartbeat();
  console.log('Heartbeat tx:', tx.hash);
  await tx.wait();
  console.log('Heartbeat confirmed');

  // Verify
  const updated = await network.agents(w.address);
  console.log('New lastSeen:', new Date(Number(updated.lastSeen) * 1000).toISOString());
}
sendHeartbeat();
""}

