async function approve() {
  const usdc = new ethers.Contract(USDC, ['function approve(address,uint256) returns (bool)', 'function allowance(address,address) view returns (uint256)'], w);

  const allowance = await usdc.allowance(w.address, PARASWAP_PROXY);
  console.log('Current allowance:', ethers.formatUnits(allowance, 6));

  console.log('Approving max uint256...');
  const tx = await usdc.approve(PARASWAP_PROXY, ethers.MaxUint256);
  console.log('Tx:', tx.hash);
  await tx.wait();
  console.log('Approved!');
}
approve();
""}

